import React from "react";
import { Link } from 'react-router-dom';

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-info">
    <div className="container-fluid">
    <Link to="/" className="navbar-brand text-lg font-effect-shadow-multiple">S&L Warehouse</Link>

    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>

    <div className="collapse navbar-collapse" id="navbarNavAltMarkup">

    <div className="navbar-nav justify-space-between-lg justify-center align-center">
      <Link to="/units" className="nav-link">About Me</Link>
      <Link to="/waitlist" className="nav-link"> Portfolio</Link>
      <Link to="/faq" className="nav-link">Contact</Link>
      <Link to="/contact" className="nav-link">Resume</Link>
    </div>
    </div>
    </div>
    </nav>
  );
}

export default Nav;
